<h1>What is the PABT/CPSS test?</h1>
<img src="data:image/jpeg;base64," style="text-align:center;padding:40px 10px 50px 10px;filter:saturate(80%);filter:brightness(101%);" width="350px" height="250px">
<h2>Pilot Attribute Battery Test(PABT)</h2>
<p>
This test aims at judging the basic skills needed by a person to qualify as a pilot. In this test, the most important things judged are
</p>
<ul>
<li>How attentively you listen to a session and how you answer the simple questions that follow?</li>
<li>What amount of focus you have in attempting questions correctly while keeping the wrong ones as low as possible?</li>
<li>Do you have a keen interest in knowing about a aircraft?</li>
</ul>
<p><b>
This way of testing has already oudated and replaced by a new test called CPSS. 
</b></p>
<h2>Computerised Pilot Selection System(CPSS)</h2>
<p>
To select the rock solid pilots to fly the advanced aircraft of Indian air force like Su-30, Tejas etc, the Indian Air Force (IAF) inaugurated the Computerized Pilot Selection System (CPSS) at 2AFSB Mysore. It has replaced the pilot aptitude battery test that was in use for decades.
<br>Like PABT test, candidate will get only one chance to clear the CPSS test, if failed, would never be eligible for flying in the armed forces, be it Air force, army, navy or coast guard. Aspirants will get only one chance to take the test under the Computerized Pilot Selection System. CPSS places special emphasis on psychomotor skills and cognitive abilities of aspirants. It ensures objectivity in results. The system will be used to screen pilots for IAF, Army, Navy and the Coast Guard
</p>
